#include <stdio.h>
#include <stdbool.h>
#include <math.h>

bool isPrime(int num) {
    int last = (int) sqrt(num);

    for (int i = 2; i <= last; ++i) {
        if (num % i == 0)
            return false;
    }

    return true;
}

int main() {
    for (int i = 1; i <= 1000; ++i) {
        if (isPrime(i)) {
            printf("[%d]", i);
        }
    }
}

